import React from "react";

const addMoney = () => {
  return (
    <div
      id="moneyTab"
      className="tab-pane container "
      // aria-expanded="true"
    >
      <form onSubmit={handleSubmit(onSubmit)}>
        <br />{" "}
        <div className="form-check form-check-inline">
          <input
            type="radio"
            id="inlineRadio1"
            value="select"
            className="form-check-input"
            {...register("plan", {
              required: "Plan type is required",
            })}
          />{" "}
          <label
            htmlFor="inlineRadio1"
            className="form-check-label"
            style={{ paddingLeft: "0px" }}
          >
            Select Plan
          </label>
        </div>{" "}
        <div
          className="form-check form-check-inline"
          style={{ marginLeft: "30px" }}
        >
          <input
            type="radio"
            id="custom"
            value="custom"
            className="form-check-input"
            {...register("plan", {
              required: "Plan type is required",
            })}
          />{" "}
          <label
            htmlFor="custom"
            className="form-check-label"
            style={{ paddingLeft: "0px" }}
          >
            Custom Plan
          </label>
        </div>{" "}
        <div className="absolute top-12 left-80">
          {errors.plan && (
            <span className="text-red-400 text-sm">{errors.plan.message}</span>
          )}
        </div>
        <div id="planFields" className="row">
          {plan === "select" && (
            <div className="col-md-12" style={{ paddingLeft: "2em" }}>
              <div className="radio">
                <label>
                  <input
                    type="radio"
                    value="365"
                    className="pay-cost"
                    {...register("amount", {
                      required: "Amount is required",
                    })}
                  />
                  {errors.amount && (
                    <span className="text-red-400 text-sm">
                      {errors.amount.message}
                    </span>
                  )}{" "}
                  1 Rs / Per Day ( Rs. 365)
                </label>
              </div>{" "}
              <div className="radio">
                <label>
                  <input
                    type="radio"
                    value="730"
                    class="pay-cost"
                    {...register("amount", {
                      required: "Amount is required",
                    })}
                  />{" "}
                  2 Rs / Per Day ( Rs. 730)
                </label>
              </div>{" "}
              <div className="radio">
                <label>
                  <input
                    type="radio"
                    value="1095"
                    className="pay-cost"
                    {...register("amount", {
                      required: "Amount is required",
                    })}
                  />{" "}
                  3 Rs / Per Day ( Rs. 1095)
                </label>
              </div>
            </div>
          )}
        </div>{" "}
        <div id="customFields" className="row">
          {plan === "custom" && (
            <div className="col-md-4" style={{ paddingLeft: "2em" }}>
              <div className="form-group">
                <label>
                  Amount: (min <i aria-hidden="true" className="fa fa-inr"></i>{" "}
                  365 / Year)
                </label>{" "}
                <input
                  type="number"
                  name="perday"
                  min="1"
                  placeholder="Amount Per Day"
                  required="required"
                  onchange="getYearAmount(this)"
                  onkeyup="getYearAmount(this)"
                  onkeydown="if(event.key==='.'){event.preventDefault();}"
                  oninput="event.target.value = event.target.value.replace(/[^0-9]*/g,'');"
                  className="form-control"
                />{" "}
                <br />{" "}
                <input
                  type="number"
                  name="amount"
                  min="365"
                  placeholder="Yearly Amount"
                  required="required"
                  readonly="readonly"
                  className="form-control pay-custom-cost"
                />
              </div>
            </div>
          )}
        </div>
        <br /> {/* button section */}
        <div className="pay">
          <button
            id="paybtn"
            type="button"
            className="razorpay-payment-button btn filled small btn-primary"
          >
            Pay with Razorpay
          </button>
        </div>
      </form>
    </div>
  );
};

export default addMoney;
